  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return <div className="chatroom">
      <div className="row">
        <div className="col">
          <div className="row"></div>
        </div>
      </div>
    </div>;
  }
}

export default ChatRoom;
